import styled from 'styled-components';
import {
  Card as BSCard,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from 'reactstrap';

export const Card = styled(BSCard)`
  && {
    border: 1px solid red;
    margin: 5px;
  }
`;
